import { Switch, Route, BrowserRouter as Router } from 'react-router-dom'
// components
import Login from './Login';
import Register from './Register';

function Home() {

    return (
        <div className="App">
                <Switch>

                    <Route path="/" exact>
                        <Login />
                    </Route>
                    <Route path="/register">
                        <Register />
                    </Route>
                    <Route path="/login">
                        <Login />
                    </Route>

                </Switch>
        </div>
    );
}

export default Home;
